const Filter = ({filterData}) => {
  return (
    <div>
      
        {filterData.map((data)=>{   //hr ek filter data k liye button bna do
            return (<button>
                {data.title}      {/*hr button me uska title daal do*/}
            </button>)
        })}

    </div>
  )
}

